import axios from "axios";


export const checkLogIn = (username, password)=>{
    return (dispatch) =>{
        axios.get("/api/logIn.json?username=" + username +"&password=" + password).then((res)=>{
            console.log(res);
        }).catch(()=>{
            console.log("login: error");
        })
    }
    

}
